import React, { useEffect, useState } from "react";
import './register.css'

function Register(){
    const [userinfo, setuserinfo] = useState({
        name:"",
        userName:"",
        password:"",
        dateOfJoining:"",
        noOfDaysInCurrentCompany:null,
        designation:"",
        reportingManager:"",
        previousClient:"",
        noOfDaysInBench:null,
        technology:"",
        phoneNumber: null,
        emailId:"",
        currentAddress:"",
        permanentAddress:"",
        laptopStatus:""
    })

 
    const postData = async () => {
     console.log(userinfo)
        // try {
        //     const response = await fetch('http://localhost:8080/saveEmployee', {
        //         method: 'POST',
        //         headers: {
        //             'Content-Type': 'application/json',
        //         },
        //         body: JSON.stringify(userinfo),
        //     });
         
        //     if (response.ok) {
                
                
        //         const data = await response.json();
        //         console.log(data);
        //     } else {
        //         console.error('Error:', response.status, response.statusText);
        //     }
        // } finally{
            
        // }
    };

       

    const handleChange = (e) => {
        const { name, value } = e.target;
        setuserinfo(prevUserInfo => ({
            ...prevUserInfo,
            [name]: value
        }));
    };

    const handleSubmit =()=>{
        postData()
        
    }
    


    
    return(
    <div className="d-flex  justify-content-center">
        <div className="cardform m-5">
        <div className='form'>
            <form> 
                <div className="first-form">
                    <label htmlFor="name">Name</label>
                    <input type='text' id="name" placeholder='Name' name="name" className="input-ele" onChange={handleChange} value={userinfo.name}/>
                    <label htmlFor="username">Username</label>
                    <input type='email' id="username" placeholder='Username' name="userName" className="input-ele" onChange={handleChange} value={userinfo.userName}/>
                    <label htmlFor="password">Password</label>
                    <input type='password' id="password" placeholder='Password' name="password" className="input-ele" onChange={handleChange} value={userinfo.password}/>
                    <label htmlFor="dateofjoin">Date of Join</label>
                    <input type='date' id="dateofjoin" placeholder='Date of join' name="dateOfJoining" className="input-ele" onChange={handleChange} value={userinfo.dateOfJoining}/>
                   
                </div>
                <div className="second-form">
                <label htmlFor="previousClient">Previous Client</label>
                <input type='text' id="previousClient" placeholder='Previous Client' name="previousClient" className="input-ele" onChange={handleChange} value={userinfo.previousClient} />
                <label htmlFor="noOfDaysInBench">No of Days in Bench</label>
                <input type='text' id="noOfDaysInBench" placeholder='No of Days in Bench' name="noOfDaysInBench" className="input-ele" onChange={handleChange} value={userinfo.noOfDaysInBench} />
                <label htmlFor="technology">Technology</label>
                <input type='text' id="technology" placeholder='Technology' name="technology" className="input-ele" onChange={handleChange} value={userinfo.technology} />
                <label htmlFor="phoneNumber">Phone Number</label>
                <input type='text' id="phoneNumber" placeholder='Phone Number' name="phoneNumber" className="input-ele" onChange={handleChange} value={userinfo.phoneNumber} />
                <label htmlFor="emailId">Email ID</label>
                <input type='text' id="emailId" placeholder='Email ID' name="emailId" className="input-ele" onChange={handleChange} value={userinfo.emailId} />
                </div>
                <div className="third-form">
                   <label htmlFor="noofDaysinCompany">No of Days in Company</label>
                    <input type='text' id="noofDaysinCompany" placeholder='No of Days in Company' name="noOfDaysInCurrentCompany" onChange={handleChange} className="input-ele" value={userinfo.noOfDaysInCurrentCompany}/>
                    <label htmlFor="designation">Designation</label>
                    <input type='text' id="designation" placeholder='Designation' name="designation" className="input-ele" onChange={handleChange} value={userinfo.designation}/>
                    <label htmlFor="reportingManager">Reporting Manager</label>
                    <input type='text' id="reportingManager" placeholder='Reporting Manager' name="reportingManager" className="input-ele" onChange={handleChange} value={userinfo.reportingManager}/>
                    <label htmlFor="currentAddress">Current Address</label>
                    <input type='text' id="currentAddress" placeholder='Current Address' name="currentAddress" className="input-ele" onChange={handleChange} value={userinfo.currentAddress} />
                    <label htmlFor="permanentAddress">Permanent Address</label>
                    <input type='text' id="permanentAddress" placeholder='Permanent Address' name="permanentAddress" className="input-ele" onChange={handleChange} value={userinfo.permanentAddress} />
                    <label htmlFor="laptopStatus">Laptop Status</label>
                    <input type='text' id="laptopStatus" placeholder='Laptop Status' name="laptopStatus" className="input-ele" onChange={handleChange} value={userinfo.laptopStatus} />

                </div>
            </form>
        </div>
        <button className="button-class" onClick={handleSubmit}>Submit</button>
        </div>
    </div>

            
    )
}

export default Register
